import React, { Component } from "react";
import Speakers from "./Speakers";

class Speaker extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div>
        <h3
          style={{
            textAlign: `center`,
            backgroundColor: `orangered`,
            color: `white`,
            padding: `20px`,
          }}
        >
          Speakers
        </h3>
        <div className="box">
          <Speakers speakers={this.state.speaker} />
        </div>
      </div>
    );
  }
}

export default Speaker;
